window.bookSummaryJSON = "<p>Life has been hard for John. Now, he’s facing eviction and the loss of his precious freedom. If he can’t turn things around, he’ll be one of the have-nots living in the brutal Benefits Towers.</p> <p>A friend gives him the opportunity to enter the fantastic <i>Land of Dreams</i>, a state-of-the-art DreamStateVR game, and he jumps at the opportunity.</p> <p>However, the idyllic village of Brunewood seems cursed. Innocent young girls are disappearing, and the ill-fated conjunction of the three moons approaches - the Blood Eye. Dark magic will be unleashed; can John and his friends save the villagers from a horrible fate?</p>"; 
